import React from 'react';
import { CsvToHtmlTable } from 'react-csv-to-table';

function pricingSheets() {
  return <CsvToHtmlTable
  style={tableStyles}
  data={sampleData}
  csvDelimiter=","
  tableClassName="table table-striped table-hover"
/>}

export default pricingSheets;
